import React from 'react';
// import { findAllInRenderedTree } from 'react-dom/test-utils';
import './Signup.css';


  
const Signin = () => {
        const  messagesignin=()=>{
          document.getElementsByClassName("alert")[0].innerHTML="Signed In successfully";
        }
        return (
  

                  <form onSubmit={ messagesignin}>
                   <div className="signin">
                       <div className="textsignin"><span >Enter Email Add.</span><input className="inputboxsignin" type="email" placeholder="abc@xyz.com" required /></div>
                       <div className="textsignin"><span >Enter Password</span><input className="inputboxsignin" type="password" placeholder="password.." pattern=".{8,}" title="Should contain 8 or more chars"  required /> </div> 
                       <div className="btnsignin"><input type="submit"  /></div>
                  </div> 
                  <div className="alert"></div>
                  </form>
                  
           
        );
        }
            


export default Signin;
